import React from 'react';

const skills = [
    { name: 'JavaScript', level: 'Advanced' },
    { name: 'React.js', level: 'Advanced' },
    { name: 'HTML & CSS', level: 'Advanced' },
    { name: 'Node.js', level: 'Intermediate' },
];

const Skills = () => {
    return (
        <section id="skills" className="py-20 bg-white">
            <div className="container mx-auto px-4">
                <h2 className="text-3xl font-bold text-center text-gray-800">Skills</h2>
                <div className="mt-8 grid grid-cols-1 md:grid-cols-2 gap-8">
                    {skills.map((skill, index) => (
                        <div key={index} className="bg-gray-100 p-6 rounded shadow-lg hover:shadow-2xl transition duration-300">
                            <h3 className="text-xl font-semibold">{skill.name}</h3>
                            <p className="mt-2 text-gray-600">{skill.level}</p>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    );
};

export default Skills;
